description:
Bree Olson, Bobbi Starr, Lily LaBeau, Chad Alva, Michael Vegas, and... Scooby?!?

After another long night of partying, Shaggy wakes to find that he is all alone? Where's Scooby? The gang gets all riled up when they discover that their favorite canine detective has gone missing. Well, there is no mystery that this group can't solve, but can they do it without their lovable cohort? One mystery uncovers another as they find themselves locked in a game of cat and mouse with a fiendish ghoul. Things get even more complicated now that Daphne and Fred are a couple, and Velma suddenly decides to release her inhibitions. Get ready for sex, mystery, sex, hilarity, sex, and more sex! Oh, and by the way....Scooby Doo, where are you?

